	[101130108] = {talk_id = 101130108, group_id = 1011301, type = 1, talk_from_type = 1, talk_content = "你这谜语人。", nest_id = 101130110, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101130109] = {talk_id = 101130109, group_id = 1011301, type = 1, talk_from_type = 1, talk_content = "那我也能给你发短信吗？", nest_id = 101130111, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101130110] = {talk_id = 101130110, group_id = 1011301, type = 1, talk_from_type = 2, talk_content = "我更希望你称之为谨言。", nest_id = 101130112, is_finish = false, waite_time = 20, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130111] = {talk_id = 101130111, group_id = 1011301, type = 1, talk_from_type = 2, talk_content = "假如有必要的话，但最好还是由我这边发起比较好。", nest_id = 101130112, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130112] = {talk_id = 101130112, group_id = 1011301, type = 1, talk_from_type = 2, talk_content = "总之快去把车翻新好吧，接下来很多地方都需要用车。", nest_id = 101130113, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130113] = {talk_id = 101130113, group_id = 1011301, type = 1, talk_from_type = 2, talk_content = "翻新好以后我这边会给你个新委托任务，正好委托人就在那附近。", nest_id = 101130114, is_finish = false, waite_time = 35, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130114] = {talk_id = 101130114, group_id = 1011301, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "", icon = "", options = {{"这次的分成是？", 101130115}, {"应该不会让我打白工吧？", 101130116}}},
	[101130115] = {talk_id = 101130115, group_id = 1011301, type = 1, talk_from_type = 1, talk_content = "这次的分成是？", nest_id = 101130117, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101130116] = {talk_id = 101130116, group_id = 1011301, type = 1, talk_from_type = 1, talk_content = "应该不会让我打白工吧？", nest_id = 101130117, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101130117] = {talk_id = 101130117, group_id = 1011301, type = 1, talk_from_type = 2, talk_content = "斤斤计较可不是好习惯，青乌。", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130901] = {talk_id = 101130901, group_id = 1011309, type = 1, talk_from_type = 2, talk_content = "对了，青乌你想知道为什么城里面会出现怪物吗？", nest_id = 101130902, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130902] = {talk_id = 101130902, group_id = 1011309, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "", icon = "", options = {{"你要告诉我吗？", 101130903}, {"不感兴趣。", 101130904}}},
	[101130903] = {talk_id = 101130903, group_id = 1011309, type = 1, talk_from_type = 1, talk_content = "你要告诉我吗？", nest_id = 101130906, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101130904] = {talk_id = 101130904, group_id = 1011309, type = 1, talk_from_type = 1, talk_content = "不感兴趣。", nest_id = 101130905, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101130905] = {talk_id = 101130905, group_id = 1011309, type = 1, talk_from_type = 2, talk_content = "别这么说，这是作为失忆人的你必须要掌握的知识。", nest_id = 101130906, is_finish = false, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130906] = {talk_id = 101130906, group_id = 1011309, type = 1, talk_from_type = 2, talk_content = "天地万物由不可见的气脉经营，而噬脉生物则瞄准着气脉薄弱的部分。", nest_id = 101130907, is_finish = false, waite_time = 35, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130907] = {talk_id = 101130907, group_id = 1011309, type = 1, talk_from_type = 2, talk_content = "简单来说你一路与之战斗的生物都是世界的敌人，他们大多会在气脉混乱的地方出现。", nest_id = 101130908, is_finish = false, waite_time = 40, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101130908] = {talk_id = 101130908, group_id = 1011309, type = 1, talk_from_type = 2, talk_content = "即便是你眼前这个漂亮的城市也不会逃过这个法则。", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101151001] = {talk_id = 101151001, group_id = 1011510, type = 1, talk_from_type = 2, talk_content = "做个正式的自我介绍吧，我叫刻刻，时时刻刻的刻刻，在维安司中工作，算是新人吧，之后请多请教！", nest_id = 101151002, is_finish = false, waite_time = 0, talk_name = "刻刻", icon = "Textures/Icon/Single/HeadIcon/SquRKeke.png", options = {}},
	[101151002] = {talk_id = 101151002, group_id = 1011510, type = 1, talk_from_type = 1, talk_content = "请多指教。", nest_id = 101151003, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101151003] = {talk_id = 101151003, group_id = 1011510, type = 1, talk_from_type = 2, talk_content = "嘿嘿。", nest_id = 0, is_finish = true, waite_time = 20, talk_name = "刻刻", icon = "Textures/Icon/Single/HeadIcon/SquRKeke.png", options = {}},
	[101170101] = {talk_id = 101170101, group_id = 1011701, type = 1, talk_from_type = 2, talk_content = "青乌，有新的委托。", nest_id = 101170102, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101170102] = {talk_id = 101170102, group_id = 1011701, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "", icon = "", options = {{"什么样的？", 101170103}}},
	[101170103] = {talk_id = 101170103, group_id = 1011701, type = 1, talk_from_type = 1, talk_content = "什么样的？", nest_id = 101170104, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101170104] = {talk_id = 101170104, group_id = 1011701, type = 1, talk_from_type = 2, talk_content = "大概可以算是纠纷吧，街区最近有位很出名的”咨询师“，大家似乎都说和咨询师聊过以后都得到建议实现了梦想。", nest_id = 101170105, is_finish = false, waite_time = 45, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101170105] = {talk_id = 101170105, group_id = 1011701, type = 1, talk_from_type = 2, talk_content = "自然，这次的委托人也付钱去进行了一次咨询，其结果就是委托人发现咨询师所说的话一句都不中。", nest_id = 101170106, is_finish = false, waite_time = 40, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101170106] = {talk_id = 101170106, group_id = 1011701, type = 1, talk_from_type = 2, talk_content = "所以委托人就气冲冲的找到了我这边，希望我主持公道。", nest_id = 101170107, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101170107] = {talk_id = 101170107, group_id = 1011701, type = 1, talk_from_type = 2, talk_content = "我会把委托人的位置发给你，你直接去看看吧。", nest_id = 101170108, is_finish = false, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101170108] = {talk_id = 101170108, group_id = 1011701, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "", icon = "", options = {{"我可不想再被蒙在鼓里。", 101170109}, {"我有空去看看。", 101170110}}},
	[101170109] = {talk_id = 101170109, group_id = 1011701, type = 1, talk_from_type = 1, talk_content = "我可不想再被蒙在鼓里。", nest_id = 101170111, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101170110] = {talk_id = 101170110, group_id = 1011701, type = 1, talk_from_type = 1, talk_content = "我有空去看看。", nest_id = 101170112, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101170111] = {talk_id = 101170111, group_id = 1011701, type = 1, talk_from_type = 2, talk_content = "这次我可没隐瞒什么，至少这次。", nest_id = 0, is_finish = false, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101170112] = {talk_id = 101170112, group_id = 1011701, type = 1, talk_from_type = 2, talk_content = "别拖太久就好。", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101190201] = {talk_id = 101190201, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "十分感谢你帮了我的客人，因为是预发送的信息，所以青乌你也只要盯着看就可以了。", nest_id = 101190202, is_finish = false, waite_time = 0, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190202] = {talk_id = 101190202, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "首先，钱财方面大部分我交给了你那位老板，你之后应该会拿到。", nest_id = 101190203, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190203] = {talk_id = 101190203, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "然后就是你关心的“青乌”的事情，我该从哪里说呢。", nest_id = 101190204, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190204] = {talk_id = 101190204, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "嗯……我本是天月城青门一派的一位祷祝，专门负责书院书籍的管理，说到青门你也应该知道吧，那可是天月城中最能代表“古老”的存在。", nest_id = 101190205, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190205] = {talk_id = 101190205, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "由于这个书库管理人的身份，我除了修行以外基本每日都看各种各样的书，而在我看过的书中，就有一本没被修进正史，却有一定可信的书籍，《创生截记》。", nest_id = 101190206, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190206] = {talk_id = 101190206, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "这本书大约创作于太阳升起之前，而在书中关于青乌的描述也不过两页，在这两页中，青乌被称呼为游荡之人。", nest_id = 101190207, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190207] = {talk_id = 101190207, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "就我从书本的内容看来，貌似青乌会在世界各种游荡，而在太阳升起的前后，青乌因为什么原因来到了这个地方。", nest_id = 101190208, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190208] = {talk_id = 101190208, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "当然我指的“地方”是天月城头上的大地，真正的土地“创生地”。", nest_id = 101190209, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190209] = {talk_id = 101190209, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "说回青乌吧，除了上面这些描述以外，书中还写了青乌战斗的样子。", nest_id = 101190210, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190210] = {talk_id = 101190210, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "如鬼神，绝情绝义，具体的句子我已经忘记，但这两个词在书中尤为显眼。", nest_id = 101190211, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190211] = {talk_id = 101190211, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "老实说，在我想起青乌这个名字的时候我还以为你会把我宰了呢，哈哈。", nest_id = 101190212, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190212] = {talk_id = 101190212, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "我知道的只有这么多了，假如还想要知道更多的话……恐怕你就只能去青门一趟，亲自翻翻《创生截记》了。", nest_id = 101190213, is_finish = false, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101190213] = {talk_id = 101190213, group_id = 1011902, type = 1, talk_from_type = 2, talk_content = "那么，后会无期，青乌。", nest_id = 0, is_finish = true, waite_time = 15, talk_name = "采桑子", icon = "Textures/Icon/Single/HeadIcon/SquNQingmennan.png", options = {}},
	[101210201] = {talk_id = 101210201, group_id = 1012102, type = 1, talk_from_type = 2, talk_content = "地址我为你标记好了，直接去找委托人吧。", nest_id = 101210202, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101210202] = {talk_id = 101210202, group_id = 1012102, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"是个什么样的委托。", 101210203}, {"真能到地上去吗？", 101210204}}},
	[101210203] = {talk_id = 101210203, group_id = 1012102, type = 1, talk_from_type = 1, talk_content = "是个什么样的委托。", nest_id = 101210205, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101210204] = {talk_id = 101210204, group_id = 1012102, type = 1, talk_from_type = 1, talk_content = "真能到地上去吗？", nest_id = 101210206, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101210205] = {talk_id = 101210205, group_id = 1012102, type = 1, talk_from_type = 2, talk_content = "伸张正义，不会是什么高难度的委托。", nest_id = 101210207, is_finish = false, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101210206] = {talk_id = 101210206, group_id = 1012102, type = 1, talk_from_type = 2, talk_content = "总比你硬闯青门要靠谱多了。", nest_id = 101210207, is_finish = false, waite_time = 20, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101210207] = {talk_id = 101210207, group_id = 1012102, type = 1, talk_from_type = 2, talk_content = "目标地是一个建筑，你到了以后和前台说自己是9527的担保人就可以了。", nest_id = 0, is_finish = true, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101210901] = {talk_id = 101210901, group_id = 1012109, type = 1, talk_from_type = 2, talk_content = "我方已受理您对于9527的保释。", nest_id = 101210902, is_finish = false, waite_time = 0, talk_name = "城务办事处", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[101210902] = {talk_id = 101210902, group_id = 1012109, type = 1, talk_from_type = 2, talk_content = "作为9527的担保人，您必须在三天内将保金交付到办事处并办理相关手续。", nest_id = 101210903, is_finish = false, waite_time = 15, talk_name = "城务办事处", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[101210903] = {talk_id = 101210903, group_id = 1012109, type = 1, talk_from_type = 2, talk_content = "更多细节与详细请咨询办事处前台或拨打办事处电话。", nest_id = 101210904, is_finish = false, waite_time = 15, talk_name = "城务办事处", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[101210904] = {talk_id = 101210904, group_id = 1012109, type = 1, talk_from_type = 2, talk_content = "谢谢合作。", nest_id = 0, is_finish = true, waite_time = 15, talk_name = "城务办事处", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[101211701] = {talk_id = 101211701, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "谢谢你，离歌那边的朋友！", nest_id = 101211702, is_finish = false, waite_time = 0, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211702] = {talk_id = 101211702, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "因为还有一会才能出去，打电话让人听见不大好，所以我就直接用短信说了。", nest_id = 101211703, is_finish = false, waite_time = 30, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211703] = {talk_id = 101211703, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "我从离歌那里知道了你想要到地上去，但却没有身份走手续流程。", nest_id = 101211704, is_finish = false, waite_time = 27, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211704] = {talk_id = 101211704, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "所以我现在要告诉你假证团伙……不，办证大师的信息和他们所在位置。", nest_id = 101211705, is_finish = false, waite_time = 30, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211705] = {talk_id = 101211705, group_id = 1012117, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"办证大师？", 101211706}, {"该不会是让我去“办证”吧？", 101211707}}},
	[101211706] = {talk_id = 101211706, group_id = 1012117, type = 1, talk_from_type = 1, talk_content = "办证大师？", nest_id = 101211708, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101211707] = {talk_id = 101211707, group_id = 1012117, type = 1, talk_from_type = 1, talk_content = "该不会是让我去“办证”吧？", nest_id = 101211710, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101211708] = {talk_id = 101211708, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "在那个团伙里面有位叫办证大师的人物，据说他可以做出能骗过一切的通行证。", nest_id = 101211709, is_finish = false, waite_time = 33, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211709] = {talk_id = 101211709, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "而那个“证”自不用说，就是出入天月城所用的出入证了。", nest_id = 101211713, is_finish = false, waite_time = 25, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211710] = {talk_id = 101211710, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "像你这样的脉者不用去“办”，直接抢就可以了，反正他们也不是什么好鸟。", nest_id = 101211711, is_finish = false, waite_time = 27, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211711] = {talk_id = 101211711, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "我保留一部分信息并没有告诉巡卫，这样你肯定能抢在巡卫捣毁那个组织前找到他们才对。", nest_id = 101211712, is_finish = false, waite_time = 37, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211712] = {talk_id = 101211712, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "他们大概会有不少有用的证件，但其中最适合你的肯定就是天月城的出入证了。", nest_id = 101211713, is_finish = false, waite_time = 35, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211713] = {talk_id = 101211713, group_id = 1012117, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"那证真能用吗？", 101211714}, {"你这么出卖同伴不要紧吗？", 101211715}}},
	[101211714] = {talk_id = 101211714, group_id = 1012117, type = 1, talk_from_type = 1, talk_content = "那证真能用吗？", nest_id = 101211716, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101211715] = {talk_id = 101211715, group_id = 1012117, type = 1, talk_from_type = 1, talk_content = "你这么出卖同伴不要紧吗？", nest_id = 101211717, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101211716] = {talk_id = 101211716, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "只要是办证大师真迹的话肯定是能用的。", nest_id = 101211718, is_finish = false, waite_time = 25, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211717] = {talk_id = 101211717, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "我和那些无恶不作的家伙才不是同伴，再说不是他们我也不会沦落到如此地步。", nest_id = 101211718, is_finish = false, waite_time = 35, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211718] = {talk_id = 101211718, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "事不宜迟，我这有两个他们最近可能会呆的移动据点，你赶快去找到办证大师，然后把出入证搞到手吧。", nest_id = 101211719, is_finish = false, waite_time = 45, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[101211719] = {talk_id = 101211719, group_id = 1012117, type = 1, talk_from_type = 2, talk_content = "顺带一提，帮我狠狠打他们一顿。", nest_id = 0, is_finish = true, waite_time = 20, talk_name = "“9527”", icon = "Textures/Icon/Single/HeadIcon/SquNJuminnan03.png", options = {}},
	[202100101] = {talk_id = 202100101, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "终于发送成功了，你就是注册名为青乌的脉者对吧？", nest_id = 202100102, is_finish = false, waite_time = 0, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100102] = {talk_id = 202100102, group_id = 2021001, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"你怎么知道我的名字", 202100103}}},
	[202100103] = {talk_id = 202100103, group_id = 2021001, type = 1, talk_from_type = 1, talk_content = "你是什么人，为什么会知道我的名字？", nest_id = 202100104, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[202100104] = {talk_id = 202100104, group_id = 2021001, type = 2, talk_from_type = 2, talk_content = "201", nest_id = 202100105, is_finish = false, waite_time = 15, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100105] = {talk_id = 202100105, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "这不算什么。自我介绍一下，这里是天月城人气少女偶像，公共交通界的先锋，午刻共享汽车客服优优小姐。", nest_id = 202100106, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100106] = {talk_id = 202100106, group_id = 2021001, type = 1, talk_from_type = 1, talk_content = "共享汽车客服？等一下，我最近应该没有违反过什么交通守则。", nest_id = 202100107, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[202100107] = {talk_id = 202100107, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "不不，我可不是只会乱收罚款的巡卫。长话短说，我发信息给你是想请求你的帮助。", nest_id = 202100108, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100108] = {talk_id = 202100108, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "我所在的午刻优优128号车上发生了一些可能造成安全和财产隐患的极危问题，简单来说，我们被劫持了！", nest_id = 202100109, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100109] = {talk_id = 202100109, group_id = 2021001, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"出什么事了", 202100110}}},
	[202100110] = {talk_id = 202100110, group_id = 2021001, type = 1, talk_from_type = 1, talk_content = "劫持？出什么事了？", nest_id = 202100111, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[202100111] = {talk_id = 202100111, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "有人带着一包红外判定为武器装备的东西上了车，还有一包疑似炸药的危险物品，所以汽车向我发送了警报。", nest_id = 202100112, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100112] = {talk_id = 202100112, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "我通过录音系统听到他们计划和他人交易这些武器，之后逃离天月城，这意味着我们公司的财产安全将在不久后受到威胁。", nest_id = 202100113, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100113] = {talk_id = 202100113, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "守护公司财产安全是我的责任，守护天月城的安全则是脉者的责任。跟我有着这么多共同点的你一定不会袖手旁观对吧？", nest_id = 202100114, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100114] = {talk_id = 202100114, group_id = 2021001, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"有点可疑（拒绝）", 202100115}, {"这忙我帮了（接受）", 202100116}}},
	[202100115] = {talk_id = 202100115, group_id = 2021001, type = 1, talk_from_type = 1, talk_content = "还是觉得有点可疑……如果看不到实物，我不会随便接取委托。", nest_id = 202100117, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[202100116] = {talk_id = 202100116, group_id = 2021001, type = 1, talk_from_type = 1, talk_content = "虽然你刚才这番话的疑点多得让人难以分析……但走私的确不是件小事。这忙我帮了。", nest_id = 202100119, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[202100117] = {talk_id = 202100117, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "怎……怎么会这样！本来以为你肯定会帮忙的……", nest_id = 202100118, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100118] = {talk_id = 202100118, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "算了算了，既然你不相信，本偶像也就不强求了。那我可就继续去找下一位救世主了！", nest_id = 0, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100119] = {talk_id = 202100119, group_id = 2021001, type = 2, talk_from_type = 2, talk_content = "204", nest_id = 202100120, is_finish = false, waite_time = 15, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100120] = {talk_id = 202100120, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "爽快！你这朋友本偶像也交定了！", nest_id = 202100121, is_finish = false, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[202100121] = {talk_id = 202100121, group_id = 2021001, type = 1, talk_from_type = 2, talk_content = "事不宜迟，请你搭乘标记好的午刻优优车辆，跟随车上的定位系统追上128号车。天月城的安宁就交给你来守护了！", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "优优", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[101240101] = {talk_id = 101240101, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "似乎有些意外收获，我没想到你和维安司这么有缘。", nest_id = 101240102, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240102] = {talk_id = 101240102, group_id = 1012401, type = 1, talk_from_type = 1, talk_content = "你也认识她们？", nest_id = 101240103, is_finish = false, waite_time = 20, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240103] = {talk_id = 101240103, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "知道而已，维安司在天月城诸多组织中都是相当特别的，应该说追识是特别的才对。", nest_id = 101240104, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240104] = {talk_id = 101240104, group_id = 1012401, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"她很强吗？", 101240105}, {"她很有钱？", 101240106}}},
	[101240105] = {talk_id = 101240105, group_id = 1012401, type = 1, talk_from_type = 1, talk_content = "她很强吗？", nest_id = 101240107, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240106] = {talk_id = 101240106, group_id = 1012401, type = 1, talk_from_type = 1, talk_content = "她很有钱？", nest_id = 101240107, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240107] = {talk_id = 101240107, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "她是天月城封侯的养女，虽然没有实权，但基于这层身份她能做到的可比一般人要多。", nest_id = 101240108, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240108] = {talk_id = 101240108, group_id = 1012401, type = 1, talk_from_type = 1, talk_content = "至今为止听见了好几次封侯这个称呼，它代表的是天月城的统治者是吧？", nest_id = 101240109, is_finish = false, waite_time = 27, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240109] = {talk_id = 101240109, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "是的，这称呼起源于古早以前……要是感兴趣你可以去找找文献。", nest_id = 101240110, is_finish = false, waite_time = 27, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240110] = {talk_id = 101240110, group_id = 1012401, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"我想听你说。", 101240111}, {"说话别说一半。", 101240112}, {"下次吧。", 101240113}}},
	[101240111] = {talk_id = 101240111, group_id = 1012401, type = 1, talk_from_type = 1, talk_content = "我想听你说。", nest_id = 101240114, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240112] = {talk_id = 101240112, group_id = 1012401, type = 1, talk_from_type = 1, talk_content = "说话别说一半。", nest_id = 101240115, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240113] = {talk_id = 101240113, group_id = 1012401, type = 1, talk_from_type = 1, talk_content = "下次吧。", nest_id = 101240116, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240114] = {talk_id = 101240114, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "……要是你哪天失眠的话就把这个当作睡前小故事吧。", nest_id = 101240117, is_finish = false, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240115] = {talk_id = 101240115, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "打字也是很累的，青乌。", nest_id = 101240117, is_finish = false, waite_time = 20, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240116] = {talk_id = 101240116, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "我就知道你对长篇大论没什么兴趣。", nest_id = 101240117, is_finish = false, waite_time = 20, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240117] = {talk_id = 101240117, group_id = 1012401, type = 1, talk_from_type = 2, talk_content = "在收到追识的下一步联络以前先回茶室一趟吧，青乌。", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101240201] = {talk_id = 101240201, group_id = 1012402, type = 1, talk_from_type = 2, talk_content = "青乌，你好，你的通行审查我已经让人为你打点好了。", nest_id = 101240202, is_finish = false, waite_time = 0, talk_name = "追识", icon = "Textures/Icon/Single/HeadIcon/SquRZhuishi.png", options = {}},
	[101240202] = {talk_id = 101240202, group_id = 1012402, type = 1, talk_from_type = 2, talk_content = "但是这中间有个小问题。", nest_id = 101240203, is_finish = false, waite_time = 20, talk_name = "追识", icon = "Textures/Icon/Single/HeadIcon/SquRZhuishi.png", options = {}},
	[101240203] = {talk_id = 101240203, group_id = 1012402, type = 1, talk_from_type = 2, talk_content = "公务局中并无你的身份记录……虽然在你要拿假证的时候我就隐约察觉到是这么回事了。", nest_id = 101240204, is_finish = false, waite_time = 35, talk_name = "追识", icon = "Textures/Icon/Single/HeadIcon/SquRZhuishi.png", options = {}},
	[101240204] = {talk_id = 101240204, group_id = 1012402, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"那现在该怎么办？", 101240205}, {"……", 101240206}}},
	[101240205] = {talk_id = 101240205, group_id = 1012402, type = 1, talk_from_type = 1, talk_content = "那现在该怎么办？", nest_id = 101240207, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240206] = {talk_id = 101240206, group_id = 1012402, type = 1, talk_from_type = 1, talk_content = "……", nest_id = 101240207, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101240207] = {talk_id = 101240207, group_id = 1012402, type = 1, talk_from_type = 2, talk_content = "你如何逃过地上耳目这件事希望你之后可以告诉我，但现在为了自证清白你大概要在公务局做点义务行动。", nest_id = 101240208, is_finish = false, waite_time = 38, talk_name = "追识", icon = "Textures/Icon/Single/HeadIcon/SquRZhuishi.png", options = {}},
	[101240208] = {talk_id = 101240208, group_id = 1012402, type = 1, talk_from_type = 2, talk_content = "那不是什么难事，天月城内有部分脉者也是靠做这些“义务”为生的。", nest_id = 101240209, is_finish = false, waite_time = 28, talk_name = "追识", icon = "Textures/Icon/Single/HeadIcon/SquRZhuishi.png", options = {}},
	[101240209] = {talk_id = 101240209, group_id = 1012402, type = 1, talk_from_type = 2, talk_content = "总之你之后有时间就到公务处报我的名字就好，会有人带你把全部事情解决的。", nest_id = 101240210, is_finish = false, waite_time = 30, talk_name = "追识", icon = "Textures/Icon/Single/HeadIcon/SquRZhuishi.png", options = {}},
	[101240210] = {talk_id = 101240210, group_id = 1012402, type = 1, talk_from_type = 2, talk_content = "当审查结束以后，我想要委托你办些事情。", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "追识", icon = "Textures/Icon/Single/HeadIcon/SquRZhuishi.png", options = {}},
	[101241401] = {talk_id = 101241401, group_id = 1012414, type = 1, talk_from_type = 2, talk_content = "您好，你在本局办理的通行审查业务已经完成，结果为通过。", nest_id = 101241402, is_finish = false, waite_time = 0, talk_name = "公务局", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[101241402] = {talk_id = 101241402, group_id = 1012414, type = 1, talk_from_type = 2, talk_content = "我们将会在一个工作日内将印鉴等相关文件送到您于天月城中的居住地址茶室“离歌”。", nest_id = 101241403, is_finish = false, waite_time = 25, talk_name = "公务局", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[101241403] = {talk_id = 101241403, group_id = 1012414, type = 1, talk_from_type = 2, talk_content = "确认无误后请回复确认，祝您生活愉快。", nest_id = 101241404, is_finish = false, waite_time = 25, talk_name = "公务局", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
