	[101250301] = {talk_id = 101250301, group_id = 1012503, type = 1, talk_from_type = 2, talk_content = "你和追识已经聊过了吧，想去地面的话就直接到这边来，青乌。", nest_id = 101250302, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101250302] = {talk_id = 101250302, group_id = 1012503, type = 3, talk_from_type = 2, talk_content = "Textures/Icon/Single/StoryImg/101250301.png", nest_id = 0, is_finish = true, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101184001] = {talk_id = 101184001, group_id = 1011840, type = 1, talk_from_type = 2, talk_content = "青乌，要进入浮空区的话你得学会“纵横术”。", nest_id = 101184002, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101184002] = {talk_id = 101184002, group_id = 1011840, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"什么东西？", 101184003}, {"我早就学会了。", 101184004}}},
	[101184003] = {talk_id = 101184003, group_id = 1011840, type = 1, talk_from_type = 1, talk_content = "什么东西？", nest_id = 101184005, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101184004] = {talk_id = 101184004, group_id = 1011840, type = 1, talk_from_type = 1, talk_content = "我早就学会了。", nest_id = 101184006, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[101184005] = {talk_id = 101184005, group_id = 1011840, type = 1, talk_from_type = 2, talk_content = "是借助气脉生万物这个特性的术法。", nest_id = 0, is_finish = true, waite_time = 20, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101184006] = {talk_id = 101184006, group_id = 1011840, type = 1, talk_from_type = 2, talk_content = "……知之为知之，不管你知还是不知，接下来就先按我说的去做吧。", nest_id = 0, is_finish = true, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101184101] = {talk_id = 101184101, group_id = 1011841, type = 1, talk_from_type = 2, talk_content = "基础的纵横术讲座就到这里吧，青乌，我最后再提醒你一句。", nest_id = 101184102, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[101184102] = {talk_id = 101184102, group_id = 1011841, type = 1, talk_from_type = 2, talk_content = "可别妄想利用纵横术跨越太阳前往“地上”，那跟跳进熔岩里面没什么区别。", nest_id = 0, is_finish = true, waite_time = 32, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[103020401] = {talk_id = 103020401, group_id = 1030204, type = 1, talk_from_type = 2, talk_content = "青乌，创生主义的接头人我已经替你联络好了。他叫义向，在天海公园等你，你直接赶过去就可以了。", nest_id = 103020402, is_finish = false, waite_time = 0, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[103020402] = {talk_id = 103020402, group_id = 1030204, type = 1, talk_from_type = 1, talk_content = "天海公园在什么位置？", nest_id = 103020403, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[103020403] = {talk_id = 103020403, group_id = 1030204, type = 1, talk_from_type = 2, talk_content = "就在天月核心区附近，是城内最大的公园，市民聚会、踏青都在那里。", nest_id = 103020404, is_finish = false, waite_time = 27, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[103020404] = {talk_id = 103020404, group_id = 1030204, type = 1, talk_from_type = 2, talk_content = "我把位置坐标发送给你吧。", nest_id = 0, is_finish = true, waite_time = 33, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[104010401] = {talk_id = 104010401, group_id = 1040104, type = 1, talk_from_type = 2, talk_content = "青乌，与悬天成为对手的感受如何？", nest_id = 104010402, is_finish = false, waite_time = 0, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104010402] = {talk_id = 104010402, group_id = 1040104, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"你们把离歌带到哪里去了？", 104010403}}},
	[104010403] = {talk_id = 104010403, group_id = 1040104, type = 1, talk_from_type = 1, talk_content = "你们把离歌带到哪里去了？", nest_id = 104010404, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[104010404] = {talk_id = 104010404, group_id = 1040104, type = 1, talk_from_type = 2, talk_content = "别生气，我们只是暂时把她控制起来而已。", nest_id = 104010405, is_finish = false, waite_time = 22, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104010405] = {talk_id = 104010405, group_id = 1040104, type = 1, talk_from_type = 2, talk_content = "毕竟悬天也不是那么好脾气，如果拒绝和我们合作，我们也就无法保证你们的安全，这点我应该提到过吧？", nest_id = 104010406, is_finish = false, waite_time = 36, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104010406] = {talk_id = 104010406, group_id = 1040104, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"你们在什么地方？", 104010407}, {"你们想要什么？", 104010409}}},
	[104010407] = {talk_id = 104010407, group_id = 1040104, type = 1, talk_from_type = 1, talk_content = "你们在什么地方？", nest_id = 104010408, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[104010408] = {talk_id = 104010408, group_id = 1040104, type = 1, talk_from_type = 2, talk_content = "在一个你睁眼就能看到，但却不一定能轻松到达的地方哦。", nest_id = 104010411, is_finish = false, waite_time = 30, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104010409] = {talk_id = 104010409, group_id = 1040104, type = 1, talk_from_type = 1, talk_content = "你们想要什么？", nest_id = 104010410, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[104010410] = {talk_id = 104010410, group_id = 1040104, type = 1, talk_from_type = 2, talk_content = "不愧是青乌，理解事态的速度也比一般人快呢。", nest_id = 104010411, is_finish = false, waite_time = 22, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104010411] = {talk_id = 104010411, group_id = 1040104, type = 1, talk_from_type = 2, talk_content = "带着溶液，到地上的“创生地”来找我赔罪吧，青乌。", nest_id = 104010412, is_finish = false, waite_time = 25, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104010412] = {talk_id = 104010412, group_id = 1040104, type = 1, talk_from_type = 2, talk_content = "最好别太慢，不然你的伙伴该等急了呢。", nest_id = 0, is_finish = true, waite_time = 20, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104070101] = {talk_id = 104070101, group_id = 1040701, type = 1, talk_from_type = 2, talk_content = "欢迎来到创生地，青乌。", nest_id = 104070102, is_finish = false, waite_time = 0, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104070102] = {talk_id = 104070102, group_id = 1040701, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"你怎么知道我在哪里的？", 104070103}}},
	[104070103] = {talk_id = 104070103, group_id = 1040701, type = 1, talk_from_type = 1, talk_content = "你怎么知道我在哪里的？", nest_id = 104070104, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[104070104] = {talk_id = 104070104, group_id = 1040701, type = 1, talk_from_type = 2, talk_content = "当然是看到了你从钟悬降落的英姿了。不愧是要拯救同伴于水火之中的人啊，青乌。", nest_id = 104070105, is_finish = false, waite_time = 33, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104070105] = {talk_id = 104070105, group_id = 1040701, type = 1, talk_from_type = 2, talk_content = "对了，赔礼道歉的姿态和台词都准备好了吗？太敷衍的话我可是不会买账的。", nest_id = 104070106, is_finish = false, waite_time = 30, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104070106] = {talk_id = 104070106, group_id = 1040701, type = 1, talk_from_type = 1, talk_content = "不用兜圈子了，你和离歌到底在什么地方？", nest_id = 104070107, is_finish = false, waite_time = 22, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[104070107] = {talk_id = 104070107, group_id = 1040701, type = 1, talk_from_type = 2, talk_content = "当然是在方便见面的开阔地带了，顺着你眼前的山路一路向上就能找到我们。", nest_id = 104070108, is_finish = false, waite_time = 30, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104070108] = {talk_id = 104070108, group_id = 1040701, type = 1, talk_from_type = 2, talk_content = "不过……山路上可有不少“伙伴”在等着你。记得小心点，毕竟我也不想看到你们两个还没见面就阴阳两隔呢。", nest_id = 104070109, is_finish = false, waite_time = 36, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[104070109] = {talk_id = 104070109, group_id = 1040701, type = 1, talk_from_type = 2, talk_content = "好好努力证明自己的实力吧，青乌。", nest_id = 0, is_finish = true, waite_time = 20, talk_name = "余辜", icon = "Textures/Icon/Single/HeadIcon/SquMBoss3yugu.png", options = {}},
	[102331501] = {talk_id = 102331501, group_id = 1023315, type = 1, talk_from_type = 2, talk_content = "你好，我是”封侯密诏“的运营部门负责人。", nest_id = 102331502, is_finish = false, waite_time = 0, talk_name = "诏令运营", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
