	[102331504] = {talk_id = 102331504, group_id = 1023315, type = 1, talk_from_type = 1, talk_content = "封侯密诏是？", nest_id = 102331505, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102331505] = {talk_id = 102331505, group_id = 1023315, type = 1, talk_from_type = 2, talk_content = "封侯密诏是一个自古传承下来的办事方法，你只要理解成我们把一部分保护城市的工作交给有能力的人就好。", nest_id = 102331506, is_finish = false, waite_time = 25, talk_name = "诏令运营", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102331506] = {talk_id = 102331506, group_id = 1023315, type = 1, talk_from_type = 2, talk_content = "开门见山，我们希望你能够承接“封侯密诏”，为天月城的安宁贡献一分力量。", nest_id = 102331507, is_finish = false, waite_time = 25, talk_name = "诏令运营", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102331507] = {talk_id = 102331507, group_id = 1023315, type = 1, talk_from_type = 2, talk_content = "当然这不会是白做工，每当你完成一份密诏，我们都会给你相应的奖励。", nest_id = 102331508, is_finish = false, waite_time = 30, talk_name = "诏令运营", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
