	[102331512] = {talk_id = 102331512, group_id = 1023315, type = 6, talk_from_type = 2, talk_content = "对方切断了对话", nest_id = 0, is_finish = true, waite_time = 0, talk_name = "诏令运营", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102361601] = {talk_id = 102361601, group_id = 1023616, type = 1, talk_from_type = 2, talk_content = "你好，听说你想在遥遥街打听点什么。", nest_id = 102361602, is_finish = false, waite_time = 0, talk_name = "遥遥街老板", icon = "Textures/Icon/Single/HeadIcon/SquNLaorennan.png", options = {}},
	[102361602] = {talk_id = 102361602, group_id = 1023616, type = 1, talk_from_type = 2, talk_content = "假如有需要的话就到这个店铺来。", nest_id = 102361603, is_finish = false, waite_time = 30, talk_name = "遥遥街老板", icon = "Textures/Icon/Single/HeadIcon/SquNLaorennan.png", options = {}},
	[102361603] = {talk_id = 102361603, group_id = 1023616, type = 1, talk_from_type = 2, talk_content = "我们可以慢慢聊。", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "遥遥街老板", icon = "Textures/Icon/Single/HeadIcon/SquNLaorennan.png", options = {}},
	[102392101] = {talk_id = 102392101, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "你好，青乌，我叫小五，刚和你说话的是类似于我分身的东西，叫喜大。", nest_id = 102392102, is_finish = false, waite_time = 0, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392102] = {talk_id = 102392102, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "而我也是望月的联络员……在你失忆之前我们就已经互相认识了。", nest_id = 102392103, is_finish = false, waite_time = 30, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392103] = {talk_id = 102392103, group_id = 1023921, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"分身？", 102392104}, {"可你名字不是叫吕五大吗？", 102392110}}},
	[102392104] = {talk_id = 102392104, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "分身？", nest_id = 102392105, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392105] = {talk_id = 102392105, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "我是七情戏的使用者，这个技术可以分离我的感情制作无论距离多远都可以操作和传话的”分身“。", nest_id = 102392106, is_finish = false, waite_time = 35, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392106] = {talk_id = 102392106, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "这分身和你本人差异挺大的。", nest_id = 102392107, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392107] = {talk_id = 102392107, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "因为我还不够熟练，所以只能任由分身释放构成它自身的情绪，而喜大所代表的感情是喜。", nest_id = 102392108, is_finish = false, waite_time = 30, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392108] = {talk_id = 102392108, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "所以才会那样嘻嘻哈哈跟坏掉一样？", nest_id = 102392109, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392109] = {talk_id = 102392109, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "是的。", nest_id = 102392113, is_finish = false, waite_time = 30, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392110] = {talk_id = 102392110, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "可你名字不是叫吕五大吗？", nest_id = 102392111, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392111] = {talk_id = 102392111, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "这边的名字不知道为啥没法改……但是请你下次不要再叫我小五了，不然我让喜大抱着你自爆。", nest_id = 102392112, is_finish = false, waite_time = 25, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392112] = {talk_id = 102392112, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "……我会谨记的。", nest_id = 102392113, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392113] = {talk_id = 102392113, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "所以青乌你工作还顺利吗？", nest_id = 102392114, is_finish = false, waite_time = 35, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392114] = {talk_id = 102392114, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "现在说是休息时间，在维安司的调查完成之前都没我的事了。", nest_id = 102392115, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392115] = {talk_id = 102392115, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "……", nest_id = 102392116, is_finish = false, waite_time = 0, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392116] = {talk_id = 102392116, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "既然这样的话可以请你帮我个忙吗？", nest_id = 102392117, is_finish = false, waite_time = 15, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392117] = {talk_id = 102392117, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "我最近打算做一个新的分身，但手边的材料都没有了，你能带上合作的供应商去取些回来吗？", nest_id = 102392118, is_finish = false, waite_time = 35, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392118] = {talk_id = 102392118, group_id = 1023921, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"好的。", 102392119}, {"有报酬吗？", 102392121}}},
	[102392119] = {talk_id = 102392119, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "好的。", nest_id = 102392120, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392120] = {talk_id = 102392120, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "谢谢，我用存下来的钱买了辆小车，你就开那辆车过去吧。", nest_id = 0, is_finish = true, waite_time = 30, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392121] = {talk_id = 102392121, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "有报酬吗？", nest_id = 102392122, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392122] = {talk_id = 102392122, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "有的……这感觉还真新鲜，之前的你就算是送的礼物也不怎么收，现在反倒问起报酬了。", nest_id = 102392123, is_finish = false, waite_time = 35, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102392123] = {talk_id = 102392123, group_id = 1023921, type = 1, talk_from_type = 1, talk_content = "对你来说这是好是坏。", nest_id = 102392124, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102392124] = {talk_id = 102392124, group_id = 1023921, type = 1, talk_from_type = 2, talk_content = "好……应该是这样吧，店外面停着我的车，你就开那辆车过去吧。", nest_id = 0, is_finish = true, waite_time = 25, talk_name = "吕五大", icon = "Textures/Icon/Single/HeadIcon/SquRWeizhirenyuan.png", options = {}},
	[102400101] = {talk_id = 102400101, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "青乌，我这边也准备好了，你拿到石龙了吗。", nest_id = 102400102, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400102] = {talk_id = 102400102, group_id = 1024001, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"你准备好了？", 102400103}, {"刚用上。", 102400107}}},
	[102400103] = {talk_id = 102400103, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "你准备好了？", nest_id = 102400104, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400104] = {talk_id = 102400104, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "嗯，我把之前许久没用的漆金重新打磨了一番，对了，漆金是我镰刀的名字。", nest_id = 102400105, is_finish = false, waite_time = 15, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400105] = {talk_id = 102400105, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "你用镰刀当武器的吗？", nest_id = 102400106, is_finish = false, waite_time = 35, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400106] = {talk_id = 102400106, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "因为使着顺手。", nest_id = 102400110, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400107] = {talk_id = 102400107, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "刚用上。", nest_id = 102400108, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400108] = {talk_id = 102400108, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "所以说你已经挺熟练了？", nest_id = 102400109, is_finish = false, waite_time = 35, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400109] = {talk_id = 102400109, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "一般吧，本身也不算难。", nest_id = 102400110, is_finish = false, waite_time = 15, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400110] = {talk_id = 102400110, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "青乌，这次我也会和你一起潜入悬天的大楼。", nest_id = 102400111, is_finish = false, waite_time = 0, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400111] = {talk_id = 102400111, group_id = 1024001, type = 4, talk_from_type = 1, talk_content = "", nest_id = 0, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {{"真的？", 102400112}, {"嗯，我等着。", 102400113}}},
	[102400112] = {talk_id = 102400112, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "真的？", nest_id = 102400114, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400113] = {talk_id = 102400113, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "嗯，我等着。", nest_id = 102400114, is_finish = false, waite_time = 0, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400114] = {talk_id = 102400114, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "我大概知道你在想些什么，但我不是只会在安全的地方发号施令的蠢人。", nest_id = 102400115, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400115] = {talk_id = 102400115, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "而且维安司那边不方便参加这次的行动，所以为了确保你的安全和任务成功我也只能亲自出马了。", nest_id = 102400116, is_finish = false, waite_time = 35, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400116] = {talk_id = 102400116, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "你偶尔说这种话让我挺难接的。", nest_id = 102400117, is_finish = false, waite_time = 15, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400117] = {talk_id = 102400117, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "至少你懂的反驳我了，这是个好兆头。", nest_id = 102400118, is_finish = false, waite_time = 35, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400118] = {talk_id = 102400118, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "（发一个地图截图，上面有个点的）", nest_id = 102400119, is_finish = false, waite_time = 30, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400119] = {talk_id = 102400119, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "具体是哪栋楼我已经给你标记好了，到时候我会先你一步用别的方法进去，找到货到底在那层。", nest_id = 102400120, is_finish = false, waite_time = 35, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400120] = {talk_id = 102400120, group_id = 1024001, type = 1, talk_from_type = 1, talk_content = "那你顺便看看货是什么不就结束了。", nest_id = 102400121, is_finish = false, waite_time = 15, talk_name = "<nick_name>", icon = "Textures/Icon/Single/HeadIcon/SquRQingwunv.png", options = {}},
	[102400121] = {talk_id = 102400121, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "现场的货估计不是一件两件，只靠我一个人效率太低了。", nest_id = 102400122, is_finish = false, waite_time = 15, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
	[102400122] = {talk_id = 102400122, group_id = 1024001, type = 1, talk_from_type = 2, talk_content = "在到达目标大楼以后你就找个方便的后门进去，然后我会引导你去指定楼层的。", nest_id = 102400123, is_finish = false, waite_time = 35, talk_name = "离歌", icon = "Textures/Icon/Single/HeadIcon/SquMBosszhuishi.png", options = {}},
